pragma solidity ^0.6.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";

contract honey is ERC20 {
    
    struct stakeTracker {
        uint256 lastBlockChecked;
        uint256 rewards;
        uint256 beeStaked;
    }

    address private owner;
    uint256 private rewardsVar;
    uint256 private gat1 = 400000000000000000;
    uint256 private gat2 = 700000000000000000;
    
    using SafeERC20 for IERC20;
    using SafeMath for uint256;
 
    address private beeAddress;
    address private fundAddress;
    IERC20 private beeToken;

    uint256 private _totalbeeStaked;
    mapping(address => stakeTracker) private _stakedBalances;
    
    constructor() public ERC20("honey token", "HNY") {
        owner = msg.sender;
        _mint(msg.sender, 10 * (10 ** 18));
        rewardsVar = 10000000;
    }
    
    event Staked(address indexed user, uint256 amount, uint256 totalbeeStaked);
    event Withdrawn(address indexed user, uint256 amount);
    event Rewards(address indexed user, uint256 reward);
    
    modifier _onlyOwner() {
        require(msg.sender == owner);
        _;
    }

    modifier updateStakingReward(address account) {
        if (block.number > _stakedBalances[account].lastBlockChecked) {
            uint256 rewardBlocks = block.number.sub(_stakedBalances[account].lastBlockChecked); 
            if (_stakedBalances[account].beeStaked > 0) {
                _stakedBalances[account].rewards = _stakedBalances[account].rewards.add(_stakedBalances[account].beeStaked.mul(rewardBlocks) / rewardsVar);
            }     
            _stakedBalances[account].lastBlockChecked = block.number;
            emit Rewards(account, _stakedBalances[account].rewards);                                                     
        }
        _;
    }


    function setbeeAddress(address _beeAddress) public _onlyOwner returns(uint256) {
        beeAddress = _beeAddress;
        beeToken = IERC20(_beeAddress);
    }
    function setfundAddress(address _fundAddress) public _onlyOwner returns(uint256) {
        fundAddress = _fundAddress;
    }
    
    function updatingStakingReward(address account) public returns(uint256) {
        if (block.number > _stakedBalances[account].lastBlockChecked) {
            uint256 rewardBlocks = block.number.sub(_stakedBalances[account].lastBlockChecked);
            if (_stakedBalances[account].beeStaked > 0) {_stakedBalances[account].rewards = _stakedBalances[account].rewards.add(_stakedBalances[account].beeStaked.mul(rewardBlocks) / rewardsVar);
            }                                   
            _stakedBalances[account].lastBlockChecked = block.number;
            emit Rewards(account, _stakedBalances[account].rewards);
        }
        return(_stakedBalances[account].rewards);
    }
    
    function getBlockNum() public view returns (uint256) {
        return block.number;
    }
    
    function getLastBlockCheckedNum(address _account) public view returns (uint256) {
        return _stakedBalances[_account].lastBlockChecked;
    }

    function getAddressStakeAmount(address _account) public view returns (uint256) {
        return _stakedBalances[_account].beeStaked;
    }
    
    function setRewardsVar(uint256 _amount) public _onlyOwner {
        rewardsVar = _amount;
    }
    
    function totalStakedSupply() public view returns (uint256) {
        return _totalbeeStaked;
    }

    function myRewardsBalance(address account) public view returns (uint256) {
        if (block.number > _stakedBalances[account].lastBlockChecked) {
            uint256 rewardBlocks = block.number.sub(_stakedBalances[account].lastBlockChecked);
            if (_stakedBalances[account].beeStaked > 0) {
                return _stakedBalances[account].rewards.add(_stakedBalances[account].beeStaked.mul(rewardBlocks) / rewardsVar);
            }                                                  
        }
    }

    function stake(uint256 amount) public updateStakingReward(msg.sender) {
        _totalbeeStaked = _totalbeeStaked.add(amount);
        _stakedBalances[msg.sender].beeStaked = _stakedBalances[msg.sender].beeStaked.add(amount);
        beeToken.safeTransferFrom(msg.sender, address(this), amount);
        emit Staked(msg.sender, amount, _totalbeeStaked);
    }

    function withdraw(uint256 amount) public updateStakingReward(msg.sender) {
        _totalbeeStaked = _totalbeeStaked.sub(amount);
        _stakedBalances[msg.sender].beeStaked = _stakedBalances[msg.sender].beeStaked.sub(amount);
        beeToken.safeTransfer(msg.sender, amount);
        emit Withdrawn(msg.sender, amount);
    }
    
   function getReward() public updateStakingReward(msg.sender) {
       uint256 reward = _stakedBalances[msg.sender].rewards;
       _stakedBalances[msg.sender].rewards = 0;
       if (reward >= gat1 && reward <= gat2) {
           _mint(msg.sender, reward.mul(8) / 10);
           uint256 fundingPoolReward = reward.mul(2) / 10;
           _mint(fundAddress, fundingPoolReward);
       } else if (reward >= gat2 ) {
           _mint(msg.sender, reward.mul(7) / 10);
           uint256 fundingPoolReward = reward.mul(3) / 10;
           _mint(fundAddress, fundingPoolReward);
       } else {
           _mint(msg.sender, reward.mul(9) / 10);
           uint256 fundingPoolReward = reward.mul(1) / 10;
           _mint(fundAddress, fundingPoolReward);
       }
       emit Rewards(msg.sender, reward);  
   }

    
}
